import React from "react";
import './styles.scss';

const Navbar = () => (
<nav className="row bg-primary main-nav">
    <div className="col-2">
        <a href = "link" className = "nav-logo-text">
        <h4>Ds Catalog</h4>
        </a>
        <div className="col-6">
            <ul></ul>
        </div>
    </div>

</nav>
);

export default Navbar;
